import {
    scaleLinear,
    extent,
    axisLeft,
    axisBottom,
  } from 'd3';
  
  export const scatterPlot = () => {
    let width;
    let height;
    let data;
    let xValue;
    let yValue;
    let margin;
    let radius;
  
    const my = (selection) => {
      const x = scaleLinear()
        .domain(extent(data, xValue))
        .range([margin.left, width - margin.right]);
  
      const y = scaleLinear()
        .domain(extent(data, yValue))
        .range([height - margin.bottom, margin.top]);
  
      const marks = data.map((d) => ({
        x: x(xValue(d)),
        y: y(yValue(d)),
      }));
  
      const circles = selection
        .selectAll('circle')
        .data(marks)
        .join('circle')
        .attr('cx', (d) => d.x)
        .attr('cy', (d) => d.y)
        .attr('r', radius);
  
          selection
        .selectAll('.y-axis')
        .data([null])
        .join('g')
        .attr('class', 'y-axis')
        .attr('transform', `translate(${margin.left},0)`)
        .call(axisLeft(y));
  
      selection
        .selectAll('.x-axis')
        .data([null])
        .join('g')
        .attr('class', 'x-axis')
        .attr(
          'transform',
          `translate(0,${height - margin.bottom})`
        )
        .call(axisBottom(x));
      
      selection
        .selectAll('.x-axis')
         .append('text')
            .attr('class', 'x-axis')
            .attr('x', 100)
            .attr('y', -20)
            .text('TEXT');
    };
  
    my.width = function (_) {
      return arguments.length ? ((width = +_), my) : width;
    };
  
